function rect(ctx, x, y, size) {
  ctx.moveTo(x, y);
  ctx.lineTo(x + size, y);
  ctx.lineTo(x + size, y + size);
  ctx.lineTo(x, y + size);
  ctx.closePath();
}

function circle(ctx, x, y, size) {
  ctx.arc(x + size / 2, y + size / 2, size / 2, 0, Math.PI * 2);
}

function diamond(ctx, x, y, size) {
  ctx.moveTo(x + size / 2, y);
  ctx.lineTo(x, y + size / 2);
  ctx.lineTo(x + size / 2, y + size);
  ctx.lineTo(x + size, y + size / 2);
  ctx.closePath();
}

function x(ctx, x, y, size) {
  const b = size / 2;
  const a = b / 2;
  ctx.moveTo(x + a, y);
  ctx.lineTo(x, y + a);
  ctx.lineTo(x + a, y + b);
  ctx.lineTo(x, y + b + a);
  ctx.lineTo(x + a, y + b + b);
  ctx.lineTo(x + b, y + b + a);
  ctx.lineTo(x + a + b, y + b + b);
  ctx.lineTo(x + b + b, y + a + b);
  ctx.lineTo(x + a + b, y + b);
  ctx.lineTo(x + b + b, y + a);
  ctx.lineTo(x + a + b, y);
  ctx.lineTo(x + b, y + a);
  ctx.closePath();
}

function probabilityPick(pairs, rand = Math.random) {
  const table = [];
  for (let [v, p] of pairs) {
    for (let i = 0; i < p; i++) table.push(v);
  }
  return () => {
    const i = ~~(rand() * table.length);
    return table[i];
  };
}

// @see https://observablehq.com/@esperanc/random-shapes-in-a-grid#fillWithSquares
function fillWithSquares(cols, rows) {
  const maxSize = Math.min(cols, rows) - 1;
  const pick = probabilityPick(d3Range(1, maxSize + 1).map((n) => [n, 1]));
  const cells = [];
  const occupied = [];
  for (let row = 0; row < rows; row++) {
    occupied[row] = [];
    for (let col = 0; col < cols; col++) {
      cells.push({ col, row });
      occupied[row][col] = false;
    }
  }
  d3Shuffle(cells);
  const squares = [];
  const fit = (size) => {
    for (let icell = 0; icell < cells.length; icell++) {
      const { row, col } = cells[icell];
      if (col + size <= cols && row + size <= rows) {
        let ok = true;
        for (let nc = 0; ok && nc < size; nc++) {
          for (let nr = 0; ok && nr < size; nr++) {
            if (occupied[row + nr][col + nc]) ok = false;
          }
        }
        if (ok) {
          for (let nc = 0; ok && nc < size; nc++) {
            for (let nr = 0; ok && nr < size; nr++) {
              occupied[row + nr][col + nc] = true;
            }
          }
          squares.push({ row, col, size });
          for (let k = cells.length - 1; k >= 0; k--) {
            const { col, row } = cells[k];
            if (occupied[row][col]) cells.splice(k, 1);
          }
          return true;
        }
      }
    }
    return false;
  };
  let tries = (rows * cols) ** 2;
  while (tries-- > 0) {
    const size = pick();
    if (fit(size) && cells.length == 0) break;
  }
  return squares;
}

function createMatrix(scale, rotation = 0) {
  const radian = (rotation * Math.PI) / 180;
  const matrix = {
    a: Math.cos(radian) * scale,
    b: Math.sin(radian) * scale,
    c: -Math.sin(radian) * scale,
    d: Math.cos(radian) * scale,
    e: 0,
    f: 0,
  };
  return matrix;
}

function splitPatterns(pattern) {
  const patternRegex = /<pattern[\s\S]*?<\/pattern>/g;
  return pattern.match(patternRegex);
}

function replacePatternFill(pattern, fill) {
  const fillRegex = /fill="[^"]+"/;
  return pattern.replace(fillRegex, `fill="${fill}"`);
}

function replacePatternStroke(pattern, stroke) {
  const strokeRegex = /stroke="[^"]+"/;
  return pattern.replace(strokeRegex, `stroke="${stroke}"`);
}

function createPattern(patternElement) {
  const id = patternElement.match(/id="([^"]+)"/)[1];
  const width = patternElement.match(/width="([^"]+)"/)[1] ?? 100;
  const height = patternElement.match(/height="([^"]+)"/)[1] ?? 100;
  const canvas = document.createElement("canvas");
  const context = canvas.getContext("2d");
  const image = new Image();
  const svgContent = `
    <svg width="${width * 2}" height="${height * 2}" xmlns="http://www.w3.org/2000/svg" transform="scale(2, 2)">
        ${patternElement}
        <rect x="0" fill="url(#${id})" width="100%" height="100%"/>
    </svg>`;
  image.src = "data:image/svg+xml," + encodeURIComponent(svgContent);
  return new Promise((resolve) => {
    image.onload = () => {
      const pattern = context.createPattern(image, "repeat");
      const matrix = createMatrix(0.5);
      pattern.setTransform(matrix);
      resolve(pattern);
    };
  });
}

export async function rectPack(imageData, { width, height, resolve }) {
  let index = 0,
    color = scaleImageColor([width, height], imageData),
    background = "#f9ece3",
    cols = 20,
    rows = 20,
    margin = 5,
    cellWidth = width / cols,
    cellHeight = height / rows,
    nodes = fillWithSquares(cols, rows).map((d, i) => ({ ...d, i })),
    shapes = [rect, circle, diamond, x],
    patterns = splitPatterns(pattern),
    m = shapes.length,
    n = patterns.length,
    step = Math.ceil(nodes.length / 400),
    I = cm.range(nodes.length),
    fills = await Promise.all(
      I.map((i) => {
        const d = nodes[i];
        const x = d.col * cellWidth + (d.size * cellWidth) / 2;
        const y = d.row * cellHeight + (d.size * cellHeight) / 2;
        const fill = color(x, y);
        const pattern = patterns[cm.randomInt(0, n)];
        const filledPattern = replacePatternFill(pattern, fill);
        const strokePattern = replacePatternStroke(filledPattern, fill);
        return createPattern(strokePattern);
      }),
    );

  function setup(app) {
    app.append(cm.clear, { fill: background });
  }

  function update(app) {
    const squares = nodes.slice(index, (index += step));

    app
      .data(squares)
      .append(cm.group, {
        x: (d) => d.col * cellWidth + margin,
        y: (d) => d.row * cellHeight + margin,
      })
      .append(cm.path, {
        d: (d) => {
          const size = d.size * cellWidth - margin * 2;
          const path = shapes[cm.randomInt(0, m)];
          const ctx = cm.pathContext();
          path(ctx, 0, 0, size, size);
          return ctx.toArray();
        },
        fill: (d) => fills[d.i],
        stroke: "black",
        strokeWidth: 2,
      });

    if (index > nodes.length) {
      app.stop();
      resolve();
    }
  }

  return cm
    .app({
      width,
      height,
    })
    .call(setup)
    .on("update", update)
    .start();
}
